import React from 'react';
export class Users extends React.Component {

users=[
  {id:1,
    bio:'Love busket',
    name:'Bil;'
  },
  {id:2,
    bio:'good singer',
    name:'Sara;'
  },
  {id:3,
    bio:'Fast as wind',
    name:'Jack;'
  },
  {id:.4,
    bio:'Bodybuilder',
    name:'Lilo;'
  }
  
]


  render() {

    return (
      <div>
        {
          this.users.map((el)=>(
            <div>
              <h2>
                {el.name}
              </h2>
              <p>{el.bio}</p>
            </div>
          ))
        }
      </div>
    );
  }
}
